### 2. Presale Mechanism

If you want to conduct a private sale before launching the token on a public market (e.g., a Launchpad), you might consider creating an additional contract specifically for the presale. This way, only selected early investors can purchase tokens at a pre-specified price before making them available to the general public.

#### Example: `PresaleToken` Contract

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PresaleToken {
    mapping(address => bool) private _earlyInvestors; // Store which addresses have been registered in advance

    address payable public owner;

    uint256 public tokenPriceWei;
    uint256 public startTime;
    uint256 public endTime;

    event TokenPurchase(address indexed purchaser, uint256 value);

    constructor(
        uint256 _tokenPriceWei,
        uint256 _startTime,
        uint256 _endTime,
        address _owner
