        require(_tokenPriceWei > 0, "Price must be greater than zero");
        require(_startTime < block.timestamp + 30 days, "Start time must be future");
        require(_endTime > block.timestamp, "End time must be after start time");

        owner = payable(_owner);
        tokenPriceWei = _tokenPriceWei;
        startTime = _startTime;
        endTime = _endTime;
    }

